import React from "react";
import SingleResult from "./SingleResult";
import "./SingleResult.css";

function ShowResult(props) {
  const { items } = props;
  const { pending, inProgress, done } = props.filter;

  const filteredItems = items.filter((item) => {
    if (pending && item.option === "Pending") {
      return true;
    }
    if (inProgress && item.option === "In Progress") {
      return true;
    }
    if (done && item.option === "Done") {
      return true;
    }
    return false;
  });

  return (
    <div className="showResult">
      {filteredItems.map((item) => (
        <SingleResult item={item.value} option={item.option} key={item.id} />
      ))}
    </div>
  );
}

export default ShowResult;
